import './NotefulForm.css';
import PropTypes from 'prop-types';

export default function NotefulForm(props) {
  const { className, ...otherProps } = props
  return (
    <form
      className={['Noteful-form', className].join(' ')}
      action='#'
      {...otherProps}
    />
  )

  NotefulForm.propTypes = {

  }
}
